function ChoiseAddress() {
  return (
    <div className="choise-address">
      <div className="choise-address__left">
        <div className="left__content__name">
          <span className="left__content__title">Доставка в город: </span>
          <span className="left__content__title">Новоалтайск</span>
          <img src="../images/choise_address/location.svg" />
        </div>
      </div>
      <div className="choise-address__right"></div>
    </div>
  );
}

export default ChoiseAddress;
